The Contractor shall provide Financial Consulting Services. These services include:
 
 • Researching accounting and financial matters, supporting audits; 
 • Evaluating financial, and budgetary issues and processes, assist in updating policies and procedures by providing recommendations;
 • Analyzing data, systems, and processes for improvements and fraud,
 • Assessing and monitoring risks and controls, assessing and testing control environments and recommending implementing ways to resolve weaknesses, strengthen controls; and improve processes for all entities (e.g., FHA, GNMA, etc.), programs (e.g., PIH, CPD, etc.), and offices (e.g., OCFO, CPO, etc.).

